    [],nt"revision_timestamp": "2016-02-29T01:35:08.702485",nt"name": "ph-alkalinity-temperature-salinity-and-other-variables-collected-from-time-series-profile-obser",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0112928 includes chemical,
    discrete sample, physical and time series profile data collected from Al Amir Moulay
    Abdellah in the North Atlantic Ocean and Strait of Gibraltar from 2005-05-04 to
    2007-05-08. These data include ALKALINITY, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
    NITRATE, SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
    these data include Alkalinity titrator, CTD, Spectrophotometer for pH measrement
    and bottle.nnThese data were collected by Aida F. Rios of Instituto de Investigaciones
    Marinas; Departamento de Oceanograffa and Emma Huertas of Marine Sciences Institute,
    Andalucia as part of the GIFT_CARBOGIB2005 data set. CDIAC assigned the following
    cruise ID(s) to this data set: CARBOGIB3.nnThe Global CO2 Time-series and Moorings
    Project involves international groups from 18 countries who have mounted sensors
    on moored buoys to provide high resolution time-series measurements of atmospheric
    boundary layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series
    and Moorings Project is coordinated by UNESCO International Ocean Carbon Coordination
    Project (IOCCP).",nt"license_title": null,nt"extras": [{ntt"key":
